INSERT INTO `works` VALUES (11,'2001: A Space Odyssey','Movie',NULL,'Humanity finds a mysterious object buried beneath the lunar surface and sets off to find its origins with the help of HAL 9000, the world\'s most advanced super computer.','1968-04-02'),(12,'Twelve Monkeys','Movie',NULL,'In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earth\'s population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, he\'s arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.','1995-12-29'),(13,'Talk to Her','Movie',NULL,'Two men share an odd friendship while they care for two women who are both in deep comas.','2002-03-14'),(14,'8 Mile','Movie',NULL,'The setting is Detroit in 1995. The city is divided by 8 Mile, a road that splits the town in half along racial lines. A young white rapper, Jimmy \"B-Rabbit\" Smith Jr. summons strength within himself to cross over these arbitrary boundaries to fulfill his dream of success in hip hop. With his pal Future and the three one third in place, all he has to do is not choke.','2002-11-08'),(15,'Absolute Power','Movie',NULL,'A master thief coincidentally is robbing a house where a murder—in which the President of The United States is involved—occurs in front of his eyes. He is forced to run, while holding evidence that could convict the President.','1997-02-14'),(16,'Paradise Now','Movie',NULL,'Two childhood friends are recruited for a suicide bombing in Tel Aviv.','2005-02-14'),(17,'Brazil','Movie',NULL,'Low-level bureaucrat Sam Lowry escapes the monotony of his day-to-day life through a recurring daydream of himself as a virtuous hero saving a beautiful damsel. Investigating a case that led to the wrongful arrest and eventual death of an innocent man instead of wanted terrorist Harry Tuttle, he meets the woman from his daydream, and in trying to help her gets caught in a web of mistaken identities, mindless bureaucracy and lies.','1985-02-20'),(18,'Walk the Line','Movie',NULL,'A chronicle of country music legend Johnny Cash\'s life, from his early days on an Arkansas cotton farm to his rise to fame with Sun Records in Memphis, where he recorded alongside Elvis Presley, Jerry Lee Lewis and Carl Perkins.','2005-09-13'),(19,'Million Dollar Baby','Movie',NULL,'Despondent over a painful estrangement from his daughter, trainer Frankie Dunn isn\'t prepared for boxer Maggie Fitzgerald to enter his life. But Maggie\'s determined to go pro and to convince Dunn and his cohort to help her.','2004-12-15'),(20,'Billy Elliot','Movie',NULL,'Set against the background of the 1984 Miners\' Strike, 11-year-old Billy Elliot stumbles out of the boxing ring and onto the ballet floor. He faces many trials and triumphs as he strives to conquer his family\'s set ways, inner conflict, and standing on his toes.','2000-05-18'),(21,'American History X','Movie',NULL,'Derek Vineyard is paroled after serving 3 years in prison for killing two African-American men. Through his brother, Danny Vineyard\'s narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.','1998-10-30'),(22,'War of the Worlds','Movie',NULL,'Ray Ferrier is a divorced dockworker and less-than-perfect father. Soon after his ex-wife and her new husband drop off his teenage son and young daughter for a rare weekend visit, a strange and powerful lightning storm touches down.','2005-06-28'),(23,'Mars Attacks!','Movie',NULL,'\'We come in peace\' is not what those green men from Mars mean when they invade our planet, armed with irresistible weapons and a cruel sense of humor.  This star studded cast must play victim to the alien’s fun and games in this comedy homage to science fiction films of the \'50s and \'60s.','1996-12-12'),(24,'Before Sunrise','Movie',NULL,'On his way to Vienna, American Jesse meets Céline, a student returning to Paris. After long conversations forge a surprising connection between them, Jesse convinces Celine to get off the train with him in Vienna. Since his flight to the U.S. departs the next morning and he has no money for lodging, they wander the city together, taking in the experiences of Vienna and each other.','1995-01-27'),(25,'Memento','Movie',NULL,'Leonard Shelby is tracking down the man who raped and murdered his wife. The difficulty of locating his wife\'s killer, however, is compounded by the fact that he suffers from a rare, untreatable form of short-term memory loss. Although he can recall details of life before his accident, Leonard cannot remember what happened fifteen minutes ago, where he\'s going, or why.','2000-10-11'),(26,'Blade Runner','Movie',NULL,'In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.','1982-06-25'),(27,'Hero','Movie',NULL,'One man defeated three assassins who sought to murder the most powerful warlord in pre-unified China.','2002-07-22'),(28,'Before Sunset','Movie',NULL,'Nine years later, Jesse travels across Europe giving readings from a book he wrote about the night he spent in Vienna with Celine. After his reading in Paris, Celine finds him, and they spend part of the day together before Jesse has to again leave for a flight. They are both in relationships now, and Jesse has a son, but as their strong feelings for each other start to return, both confess a longing for more.','2004-02-10'),(29,'Nausicaä of the Valley of the Wind','Movie',NULL,'After a global war, the seaside kingdom known as the Valley of the Wind remains one of the last strongholds on Earth untouched by a poisonous jungle and the powerful insects that guard it. Led by the courageous Princess Nausicaä, the people of the Valley engage in an epic struggle to restore the bond between humanity and Earth.','1984-03-11'),(30,'Miami Vice','Movie',NULL,'A case involving drug lords and murder in South Florida takes a personal turn for undercover detectives Sonny Crockett and Ricardo Tubbs. Unorthodox Crockett gets involved romantically with the Chinese-Cuban wife of a trafficker of arms and drugs, while Tubbs deals with an assault on those he loves.','2006-07-27'),(31,'Open Water','Movie',NULL,'Two divers are left out at sea without a boat. There’s nothing but water for miles, unless they look at what’s underneath them...','2004-08-06'),(32,'Raiders of the Lost Ark','Movie',NULL,'When Dr. Indiana Jones – the tweed-suited professor who just happens to be a celebrated archaeologist – is hired by the government to locate the legendary Ark of the Covenant, he finds himself up against the entire Nazi regime.','1981-06-12'),(33,'The Elementary Particles','Movie',NULL,'Based on Michel Houellebecq\'s controversial novel, Atomised (aka The Elementary Particles) focuses on Michael and Bruno, two very different half-brothers and their disturbed sexuality.  After a chaotic childhood with a hippie mother only caring for her affairs, Michael, a molecular biologist, is more interested in genes than women, while Bruno is obsessed with his sexual desires, but mostly finds his satisfaction with prostitutes.  But Bruno\'s life changes when he gets to know the experienced Christiane.  In the meantime, Michael meets Annabelle, the love of his youth, again.','2006-02-10'),(34,'Indiana Jones and the Temple of Doom','Movie',NULL,'After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees – and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.','1984-05-23'),(35,'Dirty Dancing','Movie',NULL,'Expecting the usual tedium that accompanies a summer in the Catskills with her family, 17-year-old Frances \'Baby\' Houseman is surprised to find herself stepping into the shoes of a professional hoofer—and unexpectedly falling in love.','1987-08-21'),(36,'Indiana Jones and the Last Crusade','Movie',NULL,'When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana must team up with Marcus Brody, Sallah and Elsa Schneider to follow in his father\'s footsteps and stop the Nazis from recovering the power of eternal life.','1989-05-24'),(37,'Beverly Hills Cop','Movie',NULL,'The heat is on in this fast paced action-comedy starring Eddie Murphy as Axel Foley, a street smart Detroit cop tracking down his best friend\'s killer in Beverly Hills. Axel quickly learns that his wild style doesn\'t fit in with the Beverly Hills Police Department, which assigns two officers (Judge Reinhold & John Ashton) to make sure things don\'t get out of hand. Dragging the stuffy detectives along for the ride, Axel smashes through a huge culture clash in his hilarious, high-speed pursuit of justice. Featuring cameos by Paul Reiser, Bronson Pinchot and Damon Wayans, Beverly Hills Cop is an exhilarating, sidesplitting adventure.','1984-11-30'),(38,'Land Without Bread','Movie',NULL,'An exploration —manipulated and staged— of life in Las Hurdes, in the province of Cáceres, in Extremadura, Spain, as it was in 1932. Insalubrity, misery and lack of opportunities provoke the emigration of young people and the solitude of those who remain in the desolation of one of the poorest and least developed Spanish regions at that time. (Silent short, voiced in 1937 and 1996.)','1933-12-01'),(39,'Megacities','Movie',NULL,'Megacities is a documentary about the slums of five different metropolitan cities.','1998-08-12'),(40,'Anatomy of a Murder','Movie',NULL,'Semi-retired Michigan lawyer Paul Biegler takes the case of Army Lt. Manion, who murdered a local innkeeper after his wife claimed that he raped her. Over the course of an extensive trial, Biegler parries with District Attorney Lodwick and out-of-town prosecutor Claude Dancer to set his client free, but his case rests on the victim\'s mysterious business partner, who\'s hiding a dark secret.','1959-07-01'),(41,'Kunstgriff','Movie',NULL,'Kunstgriff is a brilliantly filmed black and white short film. Andre F. Nebe gives proof of his storytelling abilities in this 6 minute film.','2002-01-01'),(42,'Armageddon','Movie',NULL,'When an asteroid threatens to collide with Earth, NASA honcho Dan Truman determines the only way to stop it is to drill into its surface and detonate a nuclear bomb. This leads him to renowned driller Harry Stamper, who agrees to helm the dangerous space mission provided he can bring along his own hotshot crew. Among them is the cocksure A.J. who Harry thinks isn\'t good enough for his daughter, until the mission proves otherwise.','1998-07-01'),(43,'Beverly Hills Cop II','Movie',NULL,'Axel heads for the land of sunshine and palm trees to find out who shot police Captain Andrew Bogomil. Thanks to a couple of old friends, Axel\'s investigation uncovers a series of robberies masterminded by a heartless weapons kingpin—and the chase is on.','1987-05-18'),(44,'Tron','Movie',NULL,'As Kevin Flynn searches for proof that he invented a hit video game, he is \'digitized\' by a laser and finds himself inside \'The Grid\', where programs suffer under the tyrannical rule of the Master Control Program (MCP). With the help of a security program called \'TRON\', Flynn seeks to free The Grid from the MCP.','1982-07-09'),(45,'Gladiator','Movie',NULL,'In the year 180, the death of emperor Marcus Aurelius throws the Roman Empire into chaos.  Maximus is one of the Roman army\'s most capable and trusted generals and a key advisor to the emperor.  As Marcus\' devious son Commodus ascends to the throne, Maximus is set to be executed.  He escapes, but is captured by slave traders.  Renamed Spaniard and forced to become a gladiator, Maximus must battle to the death with other men for the amusement of paying audiences.','2000-05-01'),(46,'All About My Mother','Movie',NULL,'A single mother in Madrid sees her only son die on his birthday as he runs to seek an actress\' autograph. Beside herself with grief, she returns to Barcelona to tell the boy\'s father about the death of the son he never knew he had.','1999-04-19'),(47,'Lock, Stock and Two Smoking Barrels','Movie',NULL,'A card shark and his unwillingly-enlisted friends need to make a lot of cash quick after losing a sketchy poker match. To do this they decide to pull a heist on a small-time gang who happen to be operating out of the flat next door.','1998-03-05'),(48,'Léon: The Professional','Movie',NULL,'Léon, the top hit man in New York, has earned a rep as an effective \"cleaner\". But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathilda\'s thoughts turn to revenge, and she considers following in Léon\'s footsteps.','1994-09-14'),(49,'Open Hearts','Movie',NULL,'Cecilie and Joachim are about to get married when a freak car accident leaves Joachim disabled, throwing their lives into a spin. The driver of the other car, Marie, and her family don’t get off lightly, either. Her husband Niels works in the hospital where he meets Cecilie and falls madly in love with her.','2002-09-06'),(50,'Taxi Driver','Movie',NULL,'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action, attempting to save a preadolescent prostitute in the process.','1976-02-09'),(51,'Run Lola Run','Movie',NULL,'Lola receives a phone call from her boyfriend Manni. He lost 100,000 DM in a subway train that belongs to a very bad guy. She has 20 minutes to raise this amount and meet Manni. Otherwise, he will rob a store to get the money. Three different alternatives may happen depending on some minor event along Lola\'s run.','1998-03-03'),(52,'Back to the Future','Movie',NULL,'Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents\' first meeting and attracting his mother\'s romantic interest. Marty must repair the damage to history by rekindling his parents\' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.','1985-07-03'),(53,'Predator','Movie',NULL,'A team of commandos on a mission in a Central American jungle find themselves hunted by an extraterrestrial warrior.','1987-06-12'),(54,'Snatch','Movie',NULL,'Unscrupulous boxing promoters, violent bookmakers, a Russian gangster, incompetent amateur robbers and supposedly Jewish jewelers fight to track down a priceless stolen diamond.','2000-09-01'),(55,'Three Colors: Blue','Movie',NULL,'Julie is haunted by her grief after living through a tragic auto wreck that claimed the life of her composer husband and young daughter. Her initial reaction is to withdraw from her relationships, lock herself in her apartment and suppress her pain. But avoiding human interactions on the bustling streets of Paris proves impossible, and she eventually meets up with Olivier, an old friend who harbors a secret love for her, and who could draw her back to reality.','1993-09-08'),(56,'Three Colors: White','Movie',NULL,'Polish immigrant Karol Karol finds himself out of a marriage, a job and a country when his French wife, Dominique, divorces him after six months due to his impotence. Forced to leave France after losing the business they jointly owned, Karol enlists fellow Polish expatriate Mikolah to smuggle him back to their homeland.','1994-01-26'),(57,'Three Colors: Red','Movie',NULL,'Valentine, a student model in Geneva, struggles with a possessive boyfriend and a troubled family. When she runs over a dog, she discovers that its owner, a retired judge, is illegally wiretapping and eavesdropping on his neighbors\' phone calls. Although Valentine is outraged, she develops a strange bond with the judge – and as the two become closer, she finds herself caught in the middle of events that could change her life.','1994-05-27'),(58,'Scarface','Movie',NULL,'After getting a green card in exchange for assassinating a Cuban government official, Tony Montana stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.','1983-12-09'),(59,'Italian for Beginners','Movie',NULL,'A group of strangers find friendship, family and love within an Italian beginners’ course.','2000-12-07'),(60,'Spring, Summer, Fall, Winter... and Spring','Movie',NULL,'An isolated lake, where an old monk lives in a small floating temple. The monk has a young boy living with him, learning to become a monk. We watch as seasons and years pass by.','2003-09-19'),(61,'Pretty Woman','Movie',NULL,'When a millionaire wheeler-dealer enters a business contract with a Hollywood hooker Vivian Ward, he loses his heart in the bargain.','1990-03-23'),(62,'The Big Lebowski','Movie',NULL,'Jeffrey \'The Dude\' Lebowski, a Los Angeles slacker who only wants to bowl and drink White Russians, is mistaken for another Jeffrey Lebowski, a wheelchair-bound millionaire, and finds himself dragged into a strange series of events involving nihilists, adult film producers, ferrets, errant toes, and large sums of money.','1998-03-06'),(63,'Match Point','Movie',NULL,'Match Point is Woody Allen’s satire of the British High Society and the ambition of a young tennis instructor to enter into it. Yet when he must decide between two women - one assuring him his place in high society, and the other that would take him far from it - palms start to sweat and a dark psychological match in his head begins.','2005-10-26'),(64,'The Untouchables','Movie',NULL,'Young Treasury Agent Elliot Ness arrives in Chicago and is determined to take down Al Capone, but it\'s not going to be easy because Capone has the police in his pocket. Ness meets Jimmy Malone, a veteran patrolman and probably the most honorable one on the force. He asks Malone to help him get Capone, but Malone warns him that if he goes after Capone, he is going to war.','1987-06-03'),(65,'Charlie and the Chocolate Factory','Movie',NULL,'A young boy wins a tour through the most magnificent chocolate factory in the world, led by the world\'s most unusual candy maker.','2005-07-13'),(66,'The Lord of the Rings: The Fellowship of the Ring','Movie',NULL,'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.','2001-12-18'),(67,'The Lord of the Rings: The Two Towers','Movie',NULL,'Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.','2002-12-18'),(68,'The Lord of the Rings: The Return of the King','Movie',NULL,'Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron\'s forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord\'s realm.','2003-12-01'),(69,'The Lord of the Rings','Movie',NULL,'The Fellowship of the Ring embark on a journey to destroy the One Ring and end Sauron\'s reign over Middle-earth.','1978-11-15'),(70,'No End','Movie',NULL,'1982, Poland. A translator loses her husband and becomes a victim of her own sorrow. She looks to sex, to her son, to law, and to hypnotism when she has nothing else in this time of martial law when Solidarity was banned.','1985-06-17'),(71,'Railway Station','Movie',NULL,'Kieslowski’s later film Dworzec (Station, 1980) portrays the atmosphere at Central Station in Warsaw after the rush hour.','1980-01-01'),(72,'Short Working Day','Movie',NULL,'Kieślowski’s study of a political strike, controversially told from the viewpoint of a Communist functionary trying to keep order.','1981-06-27'),(73,'Blind Chance','Movie',NULL,'Witek runs after a train. Three variations follow on how such a seemingly banal incident could influence the rest of Witek\'s life.','1987-01-10'),(74,'Princess Mononoke','Movie',NULL,'Ashitaka, a prince of the disappearing Emishi people, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.','1997-07-12'),(75,'Spirited Away','Movie',NULL,'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.','2001-07-20'),(76,'Gimme Shelter','Movie',NULL,'The landmark documentary about the tragically ill-fated Rolling Stones free concert at Altamont Speedway on December 6, 1969. Only four months earlier, Woodstock defined the Love Generation; now it lay in ruins on a desolate racetrack six miles outside of San Francisco.','1970-12-06'),(77,'Primary','Movie',NULL,'Primary is a documentary film about the primary elections between John F. Kennedy and Hubert Humphrey in 1960. Primary is the first documentary to use light equipment in order to follow their subjects in a more intimate filmmaking style. This unconventional way of filming created a new look for documentary films where the camera’s lens was right in the middle of what ever drama was occuring.','1960-01-01'),(78,'O Brother, Where Art Thou?','Movie',NULL,'In the deep south during the 1930s, three escaped convicts search for hidden treasure while a relentless lawman pursues them. On their journey they come across many comical characters and incredible situations. Based upon Homer\'s \'Odyssey\'.','2000-08-30'),(79,'Dont Look Back','Movie',NULL,'In this wildly entertaining vision of one of the twentieth century’s greatest artists, Bob Dylan is surrounded by teen fans, gets into heated philosophical jousts with journalists, and kicks back with fellow musicians Joan Baez, Donovan, and Alan Price.','1967-05-17'),(80,'Freaks','Movie',NULL,'A circus\' beautiful trapeze artist agrees to marry the leader of side-show performers, but his deformed friends discover she is only marrying him for his inheritance.','1932-02-12'),(81,'Groundhog Day','Movie',NULL,'A narcissistic TV weatherman, along with his attractive-but-distant producer, and his mawkish cameraman, is sent to report on Groundhog Day in the small town of Punxsutawney, where he finds himself repeating the same day over and over.','1993-02-11'),(82,'Dracula','Movie',NULL,'British estate agent Renfield travels to Transylvania to meet with the mysterious Count Dracula, who is interested in leasing a castle in London and is, unbeknownst to Renfield, a vampire. After Dracula enslaves Renfield and drives him to insanity, the pair sail to London together, and as Dracula begins preying on London socialites, the two become the subject of study for a supernaturalist professor, Abraham Van Helsing.','1931-02-12'),(83,'Mifune','Movie',NULL,'Kresten, newly wed, is on the threshold of a great career success in his father-in-law´s company. But when the death of his own father takes him back to his poverty-stricken childhood home, far out in the country, his career plans fall apart. For one thing he has to deal with his loveable, backward brother, who is now all alone; for another, he meets a stunning woman who comes to the farm as a housekeeper, in disguise of her real profession as a call-girl.','1999-03-12'),(84,'Bad Education','Movie',NULL,'Two children, Ignacio and Enrique, know love, the movies and fear in a religious school at the beginning of the 1960s. Father Manolo, director of the school and its professor of literature, is witness to and part of these discoveries. The three are followed through the next few decades, their reunion marking life and death.','2004-03-19'),(85,'Donnie Darko','Movie',NULL,'After narrowly escaping a bizarre accident, a troubled teenager is plagued by visions of a large bunny rabbit that manipulates him to commit a series of crimes.','2001-10-26'),(86,'Brokeback Mountain','Movie',NULL,'Two modern-day cowboys meet on a shepherding job in the summer of \'63, the two share a raw and powerful summer together that turns into a lifelong relationship conflict','2005-09-10'),(87,'All Quiet on the Western Front','Movie',NULL,'A young soldier faces profound disillusionment in the soul-destroying horror of World War I. Together with several other young German soldiers, he experiences the horrors of war, such evil of which he had not conceived of when signing up to fight. They eventually become sad, tormented, and confused of their purpose.','1930-04-29'),(88,'Wings of Desire','Movie',NULL,'Two angels, Damiel and Cassiel, glide through the streets of Berlin, observing the bustling population, providing invisible rays of hope to the distressed but never interacting with them. When Damiel falls in love with lonely trapeze artist Marion, the angel longs to experience life in the physical world, and finds -- with some words of wisdom from actor Peter Falk -- that it might be possible for him to take human form.','1987-05-17'),(89,'Breaking the Waves','Movie',NULL,'In a small and conservative Scottish village, a woman\'s paralytic husband convinces her to have extramarital intercourse so she can tell him about it and give him a reason for living.','1996-05-13'),(90,'Crouching Tiger, Hidden Dragon','Movie',NULL,'Two warriors in pursuit of a stolen sword and a notorious fugitive are led to an impetuous, physically-skilled, teenage nobleman\'s daughter, who is at a crossroads in her life.','2000-07-06'),(91,'The 400 Blows','Movie',NULL,'For young Parisian boy Antoine Doinel, life is one difficult situation after another. Surrounded by inconsiderate adults, including his neglectful parents, Antoine spends his days with his best friend, Rene, trying to plan for a better life. When one of their schemes goes awry, Antoine ends up in trouble with the law, leading to even more conflicts with unsympathetic authority figures.','1959-06-03'),(92,'The Secret Life of Words','Movie',NULL,'A touching story of a deaf girl who is sent to an oil rig to take care of a man who has been blinded in a terrible accident. The girl has a special ability to communicate with the men on board and especially with her patient as they share intimate moments together that will change their lives forever.','2005-12-15'),(93,'Akira','Movie',NULL,'A secret military project endangers Neo-Tokyo when it turns a biker gang member into a rampaging psychic psychopath that only two teenagers and a group of psychics can stop.','1988-07-16'),(94,'48 Hrs.','Movie',NULL,'A hard-nosed cop reluctantly teams up with a wise-cracking criminal temporarily paroled to him, in order to track down a killer.','1982-12-07'),(95,'Star Trek: The Motion Picture','Movie',NULL,'When a destructive space entity is spotted approaching Earth, Admiral Kirk resumes command of the Starship Enterprise in order to intercept, examine, and hopefully stop it.','1979-12-07'),(96,'Lost in Translation','Movie',NULL,'Two lost souls visiting Tokyo -- the young, neglected wife of a photographer and a washed-up movie star shooting a TV commercial -- find an odd solace and pensive freedom to be real in each other\'s company, away from their lives in America.','2003-09-18'),(97,'Star Trek II: The Wrath of Khan','Movie',NULL,'It is the 23rd century. The Federation Starship U.S.S. Enterprise is on routine training maneuvers and Admiral James T. Kirk seems resigned to the fact that this inspection may well be the last space mission of his career. But Khan is back. Aided by his exiled band of genetic supermen, Khan - brilliant renegade of 20th century Earth - has raided Space Station Regula One, stolen a top secret device called Project Genesis, wrested control of another Federation Starship and sets out in pursuit of the Enterprise, determined to let nothing stand in the way of his mission: kill Admiral Kirk... even if it means universal Armageddon.','1982-06-04'),(98,'The Dark Knight','Movie',NULL,'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.','2008-07-16'),(99,'Wilbur Wants to Kill Himself','Movie',NULL,'The strange comedy film of two close brothers; one, Wilbur, who wants to kill himself, and the other, Harbour, who tries to prevent this. When their father dies leaving them his bookstore they meet a woman who makes their lives a bit better yet with a bit more trouble as well.','2002-11-08'),(100,'Star Trek III: The Search for Spock','Movie',NULL,'Admiral Kirk and his bridge crew risk their careers stealing the decommissioned Enterprise to return to the restricted Genesis planet to recover Spock\'s body.','1984-06-01'),(101,'Maybe... Maybe Not','Movie',NULL,'Der Bewegte Mann is a German comedy about a heterosexual man, Axel, who is thrown out of his girlfriends home for cheating and ends up moving in with a gay man. Axel learns the advantages of living with gay men even though they are attracted to him and when his girlfriend wants him back he must make a tough decision.','1994-10-05'),(102,'The Arrival of a Train at La Ciotat','Movie',NULL,'A group of people are standing along the platform of a railway station in La Ciotat, waiting for a train. One is seen coming, at some distance, and eventually stops at the platform. Doors of the railway-cars open and attendants help passengers off and on.  Popular legend has it that, when this film was shown, the first-night audience fled the café in terror, fearing being run over by the \"approaching\" train. This legend has since been identified as promotional embellishment, though there is evidence to suggest that people were astounded at the capabilities of the Lumières\' cinématographe.','1896-01-25'),(103,'Edward Scissorhands','Movie',NULL,'A small suburban town receives a visit from a castaway unfinished science experiment named Edward.','1990-12-05'),(104,'Back to the Future Part II','Movie',NULL,'Marty and Doc are at it again in this wacky sequel to the 1985 blockbuster as the time-traveling duo head to 2015 to nip some McFly family woes in the bud. But things go awry thanks to bully Biff Tannen and a pesky sports almanac. In a last-ditch attempt to set things straight, Marty finds himself bound for 1955 and face to face with his teenage parents -- again.','1989-11-22'),(105,'The Party','Movie',NULL,'A thirteen-year-old French girl deals with moving to a new city and school in Paris, while at the same time her parents are getting a divorce.','1980-12-17'),(106,'K-PAX','Movie',NULL,'Prot is a patient at a mental hospital who claims to be from a far away planet. His psychiatrist tries to help him, only to begin to doubt his own explanations.','2001-10-22'),(107,'Star Trek IV: The Voyage Home','Movie',NULL,'It\'s the 23rd century, and a mysterious alien power is threatening Earth by evaporating the oceans and destroying the atmosphere. In a frantic attempt to save mankind, Kirk and his crew must time travel back to 1986 San Francisco where they find a world of punk, pizza and exact-change buses that are as alien as anything they\'ve ever encountered in the far reaches of the galaxy. A thrilling, action-packed Star Trek adventure!','1986-11-26'),(108,'Predator 2','Movie',NULL,'A police chief in the war-torn streets of Los Angeles discovers that an extraterrestrial creature is hunting down residents - and that he is the next target.','1990-11-20'),(109,'28 Days Later','Movie',NULL,'Twenty-eight days after a killer virus was accidentally unleashed from a British research facility, a small group of London survivors are caught in a desperate struggle to protect themselves from the infected. Carried by animals and humans, the virus turns those it infects into homicidal maniacs -- and it\'s absolutely impossible to contain.','2002-10-31'),(110,'The Party 2','Movie',NULL,'A young French teenage girl after moving to a new city falls in love with a boy and is thinking of having sex with him because her girlfriends have already done it.','1982-12-08'),(111,'Star Trek V: The Final Frontier','Movie',NULL,'The crew of the Federation starship Enterprise is called to Nimbus III, the Planet of Intergalactic Peace. They are to negotiate in a case of kidnapping only to find out that the kidnapper is a relative of Spock. This man is possessed by his life long search for the planet Shaka-Ri which is supposed to be the source of all life. Together they begin to search for this mysterious planet.','1989-06-09'),(112,'20,000 Leagues Under the Sea','Movie',NULL,'A ship sent to investigate a wave of mysterious sinkings encounters the advanced submarine, the Nautilus, commanded by Captain Nemo.','1954-12-23'),(113,'Star Trek VI: The Undiscovered Country','Movie',NULL,'After years of war, the Federation and the Klingon empire find themselves on the brink of a peace summit when a Klingon ship is nearly destroyed by an apparent attack from the Enterprise. Both worlds brace for what may be their dealiest encounter.','1991-12-06'),(114,'The Big Blue','Movie',NULL,'Two men answer the call of the ocean in this romantic fantasy-adventure.  Jacques and Enzo are a pair of friends who have been close since childhood, and who share a passion for the dangerous sport of free diving. Professional diver Jacques opted to follow in the footsteps of his father, who died at sea when Jacques was a boy; to the bewilderment of scientists, Jacques harbors a remarkable ability to adjust his heart rate and breathing pattern in the water, so that his vital signs more closely resemble that of dolphins than men.  As Enzo persuades a reluctant Jacques to compete against him in a free diving contest -- determining who can dive deeper and longer without scuba gear -- Jacques meets Johana, a beautiful insurance investigator from America, and he finds that he must choose between his love for her and his love of the sea.','1988-05-10'),(115,'Saw','Movie',NULL,'Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer abducts the morally wayward. Once captured, they must face impossible choices in a horrific game of survival. The victims must fight to win their lives back, or die trying...','2004-10-01'),(116,'The Fisher King','Movie',NULL,'Two troubled men face their terrible destinies and events of their past as they join together on a mission to find the Holy Grail and thus to save themselves.','1991-09-20'),(117,'Blown Away','Movie',NULL,'Blown Away tells the story of Jimmy Dove who works for the Boston bomb squad. Shortly after Dove leaves the force his partner is killed by a bomb that Dove thinks might have been made by someone he knows.','1994-07-01'),(118,'The Interpreter','Movie',NULL,'After Silvia Broome, an interpreter at United Nations headquarters, overhears plans of an assassination, an American Secret Service agent is sent to investigate.','2005-04-08'),(119,'Minority Report','Movie',NULL,'John Anderton is a top \'Precrime\' cop in the late-21st century, when technology can predict crimes before they\'re committed. But Anderton becomes the quarry when another investigator targets him for a murder charge.','2002-06-20'),(120,'The Good German','Movie',NULL,'An American journalist arrives in Berlin just after the end of World War Two. He becomes involved in a murder mystery surrounding a dead GI who washes up at a lakeside mansion during the Potsdam negotiations between the Allied powers. Soon his investigation connects with his search for his married pre-war German lover.','2006-12-08'),(121,'The Wizard','Movie',NULL,'Corey refuses to let his emotionally disturbed younger brother Jimmy be institutionalized, and the two run away together. They soon join forces with a resourceful girl, who notices that Jimmy has a special talent: he is a \"wizard\" at video games and can achieve the high score on absolutely everything he plays. Evading their parents and a sinister bounty hunter, the trio head for a climactic showdown at the national video game championships in California.','1989-12-15'),(122,'Jackie Brown','Movie',NULL,'Jackie Brown is a flight attendant who gets caught in the middle of smuggling cash into the country for her gunrunner boss. When the cops try to use Jackie to get to her boss, she hatches a plan — with help from a bail bondsman — to keep the money for herself.','1997-04-10'),(123,'A Clockwork Orange','Movie',NULL,'In a near-future Britain, young Alexander DeLarge and his pals get their kicks beating and raping anyone they please. When not destroying the lives of others, Alex swoons to the music of Beethoven. The state, eager to crack down on juvenile crime, gives an incarcerated Alex the option to undergo an invasive procedure that\'ll rob him of all personal agency. In a time when conscience is a commodity, can Alex change his tune?','1971-12-19'),(124,'Lucky Number Slevin','Movie',NULL,'Slevin is mistakenly put in the middle of a personal war between the city’s biggest criminal bosses. Under constant watch, Slevin must try not to get killed by an infamous assassin and come up with an idea of how to get out of his current dilemma. A film with many twists and turns.','2006-02-24'),(125,'Sin City','Movie',NULL,'Welcome to Sin City. This town beckons to the tough, the corrupt, the brokenhearted. Some call it dark… Hard-boiled. Then there are those who call it home — Crooked cops, sexy dames, desperate vigilantes. Some are seeking revenge, others lust after redemption, and then there are those hoping for a little of both. A universe of unlikely and reluctant heroes still trying to do the right thing in a city that refuses to care.','2005-04-01'),(126,'Sin City: A Dame to Kill For','Movie',NULL,'Some of Sin City\'s most hard-boiled citizens cross paths with a few of its more reviled inhabitants.','2014-08-20'),(127,'Das Dorf der Freundschaft','Movie',NULL,'A German Documentary about the “village of friendship” that was created by American Veteran George Mizo to help the Vietnamese kids suffering from the Vietnam War.','2001-08-25'),(128,'The State I Am In','Movie',NULL,'With 1970s Germany in the background, this film depicts the story of a family from the “R.A.F. Terrorist” group and their search for a normal life and their inner self.','2001-02-01'),(129,'The Name of the Rose','Movie',NULL,'14th-century Franciscan monk William of Baskerville and his young novice arrive at a conference to find that several monks have been murdered under mysterious circumstances. To solve the crimes, William must rise up against the Church\'s authority and fight the shadowy conspiracy of monastery monks using only his intelligence – which is considerable.','1986-09-24'),(130,'Star Trek: Generations','Movie',NULL,'Captain Jean-Luc Picard and the crew of the Enterprise-D find themselves at odds with the renegade scientist Soran who is destroying entire star systems. Only one man can help Picard stop Soran\'s scheme...and he\'s been dead for seventy-eight years.','1994-11-18'),(131,'Amélie','Movie',NULL,'At a tiny Parisian café, the adorable yet painfully shy Amélie accidentally discovers a gift for helping others. Soon Amelie is spending her days as a matchmaker, guardian angel, and all-around do-gooder. But when she bumps into a handsome stranger, will she find the courage to become the star of her very own love story?','2001-04-25'),(132,'Trouble in Paradise','Movie',NULL,'Thief Gaston Monescu and pickpocket Lily are partners in crime and love. Working for perfume company executive Mariette Colet, the two crooks decide to combine their criminal talents to rob their employer. Under the alias of Monsieur Laval, Gaston uses his position as Mariette\'s personal secretary to become closer to her. However, he takes things too far when he actually falls in love with Mariette, and has to choose between her and Lily.','1932-10-30'),(133,'Back to the Future Part III','Movie',NULL,'The final installment of the Back to the Future trilogy finds Marty digging the trusty DeLorean out of a mineshaft and looking for Doc in the Wild West of 1885. But when their time machine breaks down, the travelers are stranded in a land of spurs. More problems arise when Doc falls for pretty schoolteacher Clara Clayton, and Marty tangles with Buford Tannen.','1990-05-25'),(134,'Braveheart','Movie',NULL,'Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.','1995-05-24'),(135,'To Be or Not to Be','Movie',NULL,'During the Nazi occupation of Poland, an acting troupe becomes embroiled in a Polish soldier\'s efforts to track down a German spy.','1942-03-05'),(136,'Star Trek: First Contact','Movie',NULL,'The Borg, a relentless race of cyborgs, are on a direct course for Earth. Violating orders to stay away from the battle, Captain Picard and the crew of the newly-commissioned USS Enterprise E pursue the Borg back in time to prevent the invaders from changing Federation history and assimilating the galaxy.','1996-11-22'),(137,'Star Trek: Insurrection','Movie',NULL,'When an alien race and factions within Starfleet attempt to take over a planet that has \"regenerative\" properties, it falls upon Captain Picard and the crew of the Enterprise to defend the planet\'s people as well as the very ideals upon which the Federation itself was founded.','1998-12-11'),(138,'Star Trek: Nemesis','Movie',NULL,'En route to the honeymoon of William Riker to Deanna Troi on her home planet of Betazed, Captain Jean-Luc Picard and the crew of the U.S.S. Enterprise receives word from Starfleet that a coup has resulted in the installation of a new Romulan political leader, Shinzon, who claims to seek peace with the human-backed United Federation of Planets. Once in enemy territory, the captain and his crew make a startling discovery: Shinzon is human, a slave from the Romulan sister planet of Remus, and has a secret, shocking relationship to Picard himself.','2002-12-13'),(139,'Mean Streets','Movie',NULL,'A small-time hood must choose from among love, friendship and the chance to rise within the mob.','1973-10-14'),(140,'The Wages of Fear','Movie',NULL,'In the South American jungle, supplies of nitroglycerine are needed at a remote oil field. The oil company pays four men to deliver the supplies in two trucks. A tense rivalry develops between the two sets of drivers on the rough remote roads where the slightest jolt can result in death.','1953-04-22'),(141,'Hotel Rwanda','Movie',NULL,'Inspired by true events, this film takes place in Rwanda in the 1990s when more than a million Tutsis were killed in a genocide that went mostly unnoticed by the rest of the world. Hotel owner Paul Rusesabagina houses over a thousand refuges in his hotel in attempt to save their lives.','2004-03-04'),(142,'Paradise Found','Movie',NULL,'Paradise Found is a biography about the painter Paul Gauguin. Focusing on his personal conflict between citizen life and his family life and the art scene in Frane. In an incredible imagery montage Gauguin manages to make a successful living in the South Pacific, while being in opposition to France.','2003-01-01'),(143,'Dead Poets Society','Movie',NULL,'At an elite, old-fashioned boarding school in New England, a passionate English teacher inspires his students to rebel against convention and seize the potential of every day, courting the disdain of the stern headmaster.','1989-06-02'),(144,'Berlin is in Germany','Movie',NULL,'When Martin, a former GDR citizen, is released from jail, he lately becomes confronted with the consequences of the German re-unification.','2001-11-01'),(145,'Arsenic and Old Lace','Movie',NULL,'Mortimer Brewster, a newspaper drama critic, playwright and author known for his diatribes against marriage, suddenly falls in love and gets married;  but when he makes a quick trip home to tell his two maiden aunts, he finds out his aunts\' hobby - killing lonely old men and burying them in the cellar!','1944-09-01'),(146,'North by Northwest','Movie',NULL,'Advertising man Roger Thornhill is mistaken for a spy, triggering a deadly cross-country chase.','1959-07-08'),(147,'Saw III','Movie',NULL,'Jigsaw has disappeared. Along with his new apprentice Amanda, the puppet-master behind the cruel, intricate games that have terrified a community and baffled police has once again eluded capture and vanished. While city detective scramble to locate him, Doctor Lynn Denlon and Jeff Reinhart are unaware that they are about to become the latest pawns on his vicious chessboard.','2006-10-27'),(148,'Saw II','Movie',NULL,'When a new murder victim is discovered with all the signs of Jigsaw\'s hand, Detective Eric Matthews begins a full investigation and apprehends Jigsaw with little effort. But for Jigsaw, getting caught is just another part of his plan. Eight more of his victims are already fighting for their lives and now it\'s time for Matthews to join the game.','2005-10-28'),(149,'Ali: Fear Eats the Soul','Movie',NULL,'Emmi Kurowski, a cleaning lady, is lonely in her old age. Her husband died years ago, and her grown children offer little companionship. One night she goes to a bar frequented by Arab immigrants and strikes up a friendship with middle-aged mechanic Ali. Their relationship soon develops into something more, and Emmi\'s family and neighbors criticize their spontaneous marriage. Soon Emmi and Ali are forced to confront their own insecurities about their future.','1974-06-05'),(150,'Indiana Jones and the Kingdom of the Crystal Skull','Movie',NULL,'Set during the Cold War, the Soviets—led by sword-wielding Irina Spalko—are in search of a crystal skull which has supernatural powers related to a mystical Lost City of Gold. Indy is coerced to head to Peru at the behest of a young man whose friend—and Indy\'s colleague—Professor Oxley has been captured for his knowledge of the skull\'s whereabouts.','2008-05-21'),(151,'The Terminator','Movie',NULL,'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the \"Terminator\" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?','1984-10-26'),(152,'Volver','Movie',NULL,'Raimunda lives and works in Madrid with her husband Paco and their daughter Paula. Raimunda\'s sister Sole lives nearby. The two sisters miss their mother Irene who died several years ago in a house fire along with their father. When a former neighbor from their hometown reports that she has seen the ghost of Irene, the daughters do not believe her. After a murder and a family tragedy, however, Irene\'s spirit materializes around her daughters to comfort them.','2006-03-16'),(153,'East of Eden','Movie',NULL,'In the Salinas Valley in and around World War I, Cal Trask feels he must compete against overwhelming odds with his brother for the love of their father. Cal is frustrated at every turn, from his reaction to the war, how to get ahead in business and in life, and how to relate to his estranged mother.','1955-04-10'),(154,'Rebel Without a Cause','Movie',NULL,'After moving to a new town, troublemaking teen Jim Stark is supposed to have a clean slate, although being the new kid in town brings its own problems. While searching for some stability, Stark forms a bond with a disturbed classmate, Plato, and falls for local girl Judy. However, Judy is the girlfriend of neighborhood tough, Buzz. When Buzz violently confronts Jim and challenges him to a drag race, the new kid\'s real troubles begin.','1955-10-29'),(155,'Berlin: Symphony of a Great City','Movie',NULL,'A train speeds through the country on its way to Berlin, then gradually slows down as it pulls into the station. It is very early in the morning, about 5:00 AM, and the great city is mostly quiet. But before long there are some signs of activity, and a few early risers are to be seen on the streets. Soon the new day is well underway. It\'s just a typical day in Berlin, but a day full of life and energy.','1927-09-23'),(156,'Rebecca','Movie',NULL,'Story of a young woman who marries a fascinating widower only to find out that she must live in the shadow of his former wife, Rebecca, who died mysteriously several years earlier. The young wife must come to grips with the terrible secret of her handsome, cold husband, Max De Winter. She must also deal with the jealous, obsessed Mrs. Danvers, the housekeeper, who will not accept her as the mistress of the house.','1940-03-23'),(157,'Man of Marble','Movie',NULL,'Man of Marble is a Polish film about a student making a film about a bricklayer who was once idolized. She interviews people who knew him and finds old footage that lead to an unfolding mystery that causes her producer to cancel the project.','1977-02-25'),(158,'Man of Iron','Movie',NULL,'In Warsaw in 1980, the Communist Party sends Winkel, a weak, alcoholic TV hack, to Gdansk to dig up dirt on the shipyard strikers, particularly on Maciek Tomczyk, an articulate worker whose father was killed in the December 1970 protests. Posing as sympathetic, Winkel interviews the people surrounding Tomczyk, including his detained wife, Agnieszka.','1981-07-27'),(159,'The Outsiders','Movie',NULL,'When two poor Greasers, Johnny, and Ponyboy are assaulted by a vicious gang, the Socs, and Johnny kills one of the attackers, tension begins to mount between the two rival gangs, setting off a turbulent chain of events.','1983-03-25'),(160,'The Blue Angel','Movie',NULL,'Prim professor Immanuel Rath finds some of his students ogling racy photos of cabaret performer Lola Lola and visits a local club, The Blue Angel, in an attempt to catch them there. Seeing Lola perform, the teacher is filled with lust, eventually resigning his position at the school to marry the young woman. However, his marriage to a coquette -- whose job is to entice men -- proves to be more difficult than Rath imagined.','1930-04-01'),(161,'The Bride of Frankenstein','Movie',NULL,'Bride of Frankenstein begins where James Whale\'s Frankenstein from 1931 ended. Dr. Frankenstein has not been killed as previously portrayed and now he wants to get away from the mad experiments. Yet when his wife is kidnapped by his creation, Frankenstein agrees to help him create a new monster, this time a woman.','1935-04-20'),(162,'Syriana','Movie',NULL,'The Middle Eastern oil industry is the backdrop of this tense drama, which weaves together numerous story lines. Bennett Holiday is an American lawyer in charge of facilitating a dubious merger of oil companies, while Bryan Woodman, a Switzerland-based energy analyst, experiences both personal tragedy and opportunity during a visit with Arabian royalty. Meanwhile, veteran CIA agent Bob Barnes uncovers an assassination plot with unsettling origins.','2005-11-23'),(163,'Rumble Fish','Movie',NULL,'Rusty James, an absent-minded street thug, struggles to live up to his legendary older brother\'s reputation, and longs for the days when gang warfare was going on.','1983-10-20'),(164,'The Wanderers','Movie',NULL,'The streets of the Bronx are owned by \'60s youth gangs where the joy and pain of adolescence is lived. Philip Kaufman tells his take on the novel by Richard Price about the history of the Italian-American gang ‘The Wanderers.’','1979-07-13'),(165,'The Cabinet of Dr. Caligari','Movie',NULL,'Francis, a young man, recalls in his memory the horrible experiences he and his fiancée Jane recently went through. Francis and his friend Alan visit The Cabinet of Dr. Caligari, an exhibit where the mysterious doctor shows the somnambulist Cesare, and awakens him for some moments from his death-like sleep.','1920-02-27'),(166,'Stand by Me','Movie',NULL,'Gordie, Chris, Teddy and Vern are four friends who decide to hike to find the corpse of Ray Brower, a local teenager, who was hit by a train while plucking blueberries in the wild.','1986-08-08'),(167,'Young Adam','Movie',NULL,'A young drifter working on a river barge disrupts his employers\' lives while hiding the fact that he knows more about a dead woman found in the river than he admits.','2003-09-26'),(168,'The Godfather','Movie',NULL,'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.','1972-03-14'),(169,'Some Like It Hot','Movie',NULL,'Two musicians witness a mob hit and struggle to find a way out of the city before they are found by the gangsters. Their only opportunity is to join an all-girl band as they leave on a tour. To make their getaway they must first disguise themselves as women, then keep their identities secret and deal with the problems this brings - such as an attractive bandmate and a very determined suitor.','1959-03-19'),(170,'The Godfather: Part II','Movie',NULL,'In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.','1974-12-20'),(171,'Natural Born Killers','Movie',NULL,'Two victims of traumatized childhoods become lovers and psychopathic serial murderers irresponsibly glorified by the mass media.','1994-08-25'),(172,'The Godfather: Part III','Movie',NULL,'In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don, Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.','1990-12-25'),(173,'High Fidelity','Movie',NULL,'When record store owner Rob Gordon gets dumped by his girlfriend, Laura, because he hasn\'t changed since they met, he revisits his top five breakups of all time in an attempt to figure out what went wrong. As Rob seeks out his former lovers to find out why they left, he keeps up his efforts to win Laura back.','2000-03-17'),(174,'King Kong','Movie',NULL,'Adventurous filmmaker, Carl Denham, sets out to produce a motion picture unlike anything the world has seen before. Alongside his leading lady Ann Darrow and his first mate Jack Driscoll, they arrive on an island and discover a legendary creature said to be neither beast nor man. Denham captures the monster to displayed on Broadway as Kong, the eighth wonder of the world.','1933-03-15'),(175,'About a Boy','Movie',NULL,'Will Freeman is a good-looking, smooth-talking bachelor whose primary goal in life is avoiding any kind of responsibility. But when he invents an imaginary son in order to meet attractive single moms, Will gets a hilarious lesson about life from a bright, but hopelessly geeky 12-year-old named Marcus. Now, as Will struggles to teach Marcus the art of being cool, Marcus teaches Will that you\'re never too old to grow up.','2002-04-26'),(176,'Zatoichi','Movie',NULL,'Zatoichi is a 19th century blind nomad who makes his living as a gambler and masseur. However, behind this humble facade, he is a master swordsman gifted with a lightning-fast draw and breathtaking precision. While wandering, Zatoichi discovers a remote mountain village at the mercy of Ginzo, a ruthless gang-leader. Ginzo disposes of anyone who gets in his way, especially after hiring the mighty samurai ronin, Hattori, as a bodyguard. After a raucous night of gambling in town, Zatoichi encounters a pair of geishas--as dangerous as they are beautiful--who\'ve come to avenge their parents\' murder. As the paths of these and other colorful characters intertwine, Ginzo\'s henchmen are soon after Zatoichi. With his legendary cane sword at his side, the stage is set for a riveting showdown.','2003-09-06'),(177,'The Killing','Movie',NULL,'Career criminal Johnny Clay recruits a sharpshooter, a crooked police officer, a bartender and a betting teller named George, among others, for one last job before he goes straight and gets married. But when George tells his restless wife about the scheme to steal millions from the racetrack where he works, she hatches a plot of her own.','1956-06-06'),(178,'Pocketful of Miracles','Movie',NULL,'Boozy, brassy Apple Annie, a beggar with a basket of apples, is as much a part of downtown New York as old Broadway itself. Bootlegger Dave the Dude is a sucker for her apples -- he thinks they bring him luck. But Dave and girlfriend Queenie Martin need a lot more than luck when it turns out that Annie is in a jam and only they can help: Annie\'s daughter Louise, who has lived all her life in a Spanish convent, is coming to America with a Count and his son. The count\'s son wants to marry Louise, who thinks her mother is part of New York society. It\'s up to Dave and Queenie and their cronies to turn Annie into a lady and convince the Count and his son that they are hobnobbing with New York\'s elite.','1961-12-18'),(179,'The War of the Roses','Movie',NULL,'The Roses, Barbara and Oliver, live happily as a married couple. Then she starts to wonder what life would be like without Oliver, and likes what she sees. Both want to stay in the house, and so they begin a campaign to force each other to leave. In the middle of the fighting is D\'Amato, the divorce lawyer. He gets to see how far both will go to get rid of the other, and boy do they go far.','1989-12-08');
